import React, { useEffect, useState } from "react";
import "./Result.css";

export default function Result({ searchCriteria }) {
  const [cars, setCars] = useState([]);

  useEffect(() => {
    // 构建查询参数
    const queryParams = new URLSearchParams(searchCriteria).toString();

    // 获取汽车数据
    fetch(`http://localhost:3002/cars?${queryParams}`)
      .then((response) => response.json())
      .then((data) => setCars(data))
      .catch((error) => console.error("Error fetching cars:", error));
  }, [searchCriteria]); // 当 searchCriteria 变化时重新获取数据

  return (
    <div className="result-container">
      <h2 className="text-xl font-bold mb-4">Car List</h2>
      <table className="result-table">
        <thead>
          <tr>
            <th>Make</th>
            <th>Model</th>
            <th>Year</th>
            <th>Description</th>
            <th>Odometer (km)</th>
            <th>Vehicle Condition</th>
            <th>Sale Location</th>
            <th>Sale Category</th>
            <th>Salvage Vehicle</th>
            <th>Sale Date</th>
            <th>Sale Price</th>
          </tr>
        </thead>
        <tbody>
          {cars.map((car, index) => (
            <tr key={index}>
              <td>{car.make}</td>
              <td>{car.model}</td>
              <td>{car.year}</td>
              <td>{car.description}</td>
              <td>{car.odometer}</td>
              <td>{car.car_condition}</td>
              <td>{car.states}</td>
              <td>{car.sales_category}</td>
              <td>{car.salvage_vehicle ? "Yes" : "No"}</td>
              <td>{car.sale_date}</td>
              <td>{car.sale_price}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
